import React, {Component} from 'react';

// https://www.googleapis.com/youtube/v3/search?key=AIzaSyB4xNW_TeLDTO9tKxmHQAZskoy9Na0sxR0&channelId=UCE_M8A5yxnLfW0KghEeajjw&part=snippet,id&order=date&maxResults=1

class Youtube extends Component {

	constructor(){
		super();
		this.state = {
			videos: {}
		}
	}

	componentDidMount(){
		fetch("https://www.googleapis.com/youtube/v3/search?key=AIzaSyB4xNW_TeLDTO9tKxmHQAZskoy9Na0sxR0&channelId=UCE_M8A5yxnLfW0KghEeajjw&part=snippet,id&order=date&maxResults=1")
			.then(response => response.json())
			.then(data => {
				console.log(data)
			}); 

	}
	render () {
		return (
			<div>
				<div> {console.log(this.state)} </div>
				<div> {this.state.videos.videos} </div>
			</div>
		);
	}
}

export default Youtube;
